import ReactDOM from "react-dom"
import React from "react"
import App from '../App'



class SbApp extends HTMLElement {
    connectedCallback() {
        this.mountPoint = document.createElement('span')
        this.render()
    }

    render() {
        ReactDOM.render(<React.StrictMode>
                    <App/>
            </React.StrictMode>,
            this.appendChild(this.mountPoint))
    }
}

customElements.get('sb-app') || customElements.define("sb-app", SbApp)
